def get_indexer(
    self,
    target: AnyArrayLike,
    method: Optional[str] = None,
    limit: Optional[int] = None,
    tolerance: Optional[Any] = None,
) -> np.ndarray:
    self._check_method(method)

    if self.is_overlapping():
        msg = (
            "cannot handle overlapping indices; use "
            "IntervalIndex.get_indexer_non_unique"
        )
        raise InvalidIndexError(msg)

    target_as_index = ensure_index(target)

    if isinstance(target_as_index, IntervalIndex):
        result = np.zeros(len(target_as_index), dtype=int)
        for i, (left, right) in enumerate(zip(target_as_index.left, target_as_index.right)):
            idx = self.get_loc([left, right]).values
            if len(idx) == 1 and not isinstance(idx[0], np.int64):
                # If idx is scalar, the result is an array of size 1. Get the value of the scalar.
                idx = idx[0]
            result[i] = -1 if len(idx) == 0 else idx
        return result
    else:
        indexer = []
        for key in target_as_index:
            try:
                loc = self.get_loc(key)
            except KeyError:
                loc = -1
            indexer.append(loc)

        return ensure_platform_int(indexer)
